// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;
pragma abicoder v2;

import "./SafeMath.sol";

contract Lending {
    using SafeMath for uint256;
    using SafeMath for uint256;

    enum ProposalState {
        ACCEPTED,
        ACCEPTING,
        WAITING
    }
    enum LoanState {
        REPAID,
        ACCEPTED,
        WAITING,
        PAID,
        FAILED
    }

    // borrower
    struct Proposal {
        uint256 proposalId;
        address borrower;
        uint256 amount;
        uint256 time;
        string mortgage;
        ProposalState state;
        bool sendMoney;
    }

    struct Loan {
        uint256 loanId;
        address lender;
        uint256 loanAmount;
        uint256 interestRate;
        uint256 proposalId; // not sure?
        uint256 time;
        LoanState state;
    }

    Proposal[] public proposals; // all proposals
    Loan[] public potential_lenders; // lender options
    Loan[] public loans; // confirmed loans

    mapping(uint256 => address) public proposalToBorrower; // key -> value mapping
    mapping(uint256 => address) public loanToLender; // key -> value mapping

    function createProposal(
        uint256 _loanAmount,
        uint256 _time,
        string memory _mortgage
    ) public {
        //change loanAmount to amount?
        uint256 _proposalId = proposals.length;
        proposals.push(
            Proposal(
                _proposalId,
                msg.sender,
                _loanAmount,
                _time,
                _mortgage,
                ProposalState.WAITING,
                false
            )
        );

