        potential_lenders.push(
            Loan(
                _loanId,
                msg.sender,
                _loanAmount,
                _interestRate,
                _proposalId,
                block.timestamp,
                LoanState.WAITING
            )
        );
        loanToLender[_loanId] = msg.sender;
        proposals[_proposalId].state = ProposalState.ACCEPTING;
    }

